import React from "react";
import './login.css'

const Login = () => {
    return (
        <div className="login">
           <div className="login-logo">
                <img 
                    src = "data:image/png;base64,"
                    alt = 'Login'
                    />
           </div>
        </div>
    )
}
export default Login
